      autoFocus
      fullWidth variant="standard"
      label="投稿内容"
      margin="dense"
      multiline
      // id="content"
      onChange={handleChange}
      required
      rows={4}
      sx={{ m: 1, width: '50ch' }}
      type="text"
      value={content}
    />
  )
}
